import './App.css';
//import Productos from './components/Product';
import Navbar from './components/Navbar';
import Products from './components/Products';
import SignIn from './components/Signin';

function App() {
  return (
    <Router>

    <div className="App">
      <Navbar/>
      <Switch></Switch>
      <Route path="/Signin">
      <SignIn/>
      </Route>
      <Products/>
    </div>

    </Router>
  );
}


export default App;
